            'title': "ARTS 486 Project Proposal",
            'text': "&emsp;A digital story implies an improvement over the ordinary way of telling a story through words on a page. Due to the dynamic nature of digital media, this implied improvement lies in utilizing more dynamic visuals to supplement the main concepts described in the text or images. This was exemplified in the examples shown, with most of them having strong parallels to a video-like medium, but with users controlling the pacing of it. However, I would like to more directly involve the user in the story, and rather than users controlling the pace of the story, have users create the stories. This was my original inspiration for creating a turn-based video game.<br>&emsp;<br>&emsp;This direct involvement with the user is something I really try to stress to either clientele or those I&rsquo;m working for. The classic saying is &ldquo;show, don&rsquo;t tell,&rdquo; but due to the dynamic nature of applications, a much more effective saying would be to &ldquo;do, don&rsquo;t show, and even worse don&rsquo;t tell.&rdquo; For example, if a restaurant wanted a web page that promotes their menu, most would just upload a pdf or image of the menu and call it a day. But, a motivated web designer would potentially add a barebones cart system to the menu, allowing users to add and drop certain meals to get price calculations and even lay the foundation for an eventual online ordering system. This type of forward thinking and direct involvement not only keeps the users attention, but more importantly differentiates the brand of the restaurant as a modern, innovative company and trickles down into perception of their products while motivating potentially new customers. <br><br>&emsp;This methodology is exactly what came to mind when first presented with this project, which leads to my idea of creating a mobile-friendly free-for-all checkers game. This game would blend the core mechanics of two very popular genres: social deduction and battle royal games. This is where most of my research went, so I&rsquo;ll start with the battle royal genre. This genre is extremely contemporary in the video-game medium, and exploded in popularity with titles such as PlayerUnknown Battlegrounds, Apex Legends, and Fortnite. Due to their popularity, the core mechanics have become very standardized with only slight variations in their minor mechanics. The main concept is that players are evenly placed across a large playing field with the exact same starting equipment, and eliminate each other until there is only one player left. There are two main motivating factors across all games to encourage faster progression, a timer in the form of an ever-shrinking playing field, and gameplay advantages scattered throughout the map in the form of weapons. A timer will be the only motivating factor in my game, but taken a little bit further. This game will not only have a shrinking playing field, but will also feature harsh turn timers of 30-60 seconds to achieve the same effect of fast progression. Adding in environmental advantages would create more interesting gameplay, however this implementation requires a lot more balancing as their effects on gameplay are unpredictable without significant testing.<br><br>&emsp;Social deduction games have existed in the mainstream for decades with titles like Werewolf/Mafia, Trouble in Terrorist Town and Secret Hitler, but recently rose to extreme popularity with Among Us. These games again follow the same formula, but instead vary slightly in their progression. Across all games, the win condition always relies on one of two teams gaining complete control over the game. But, unlike the rest of the titles, Secret Hitler does not rely on eliminating other players, but instead relies on enacting liberal or facist policies through voting each turn to declare a winner of either the Facist or Liberal team. Some games like Werewolf rely on a player being eliminated each round to encourage detective discussion on who&rsquo;s responsible, and other games like Trouble in Terrorist Town and Among Us push this progression even further by carrying out the game in real time without restrictions on eliminations. However, what&rsquo;s unique about this genre is that the appeal is not derived from effective feedback loops or game mechanics, but instead the interpersonal relationships between players, which is why I&rsquo;ve included this genre in my game. But, this game would differentiate itself by forcing social discussions to be strictly between two players, and encouraging discussions to consist of how to navigate a simplistic turn-based strategy game, not who caused eliminations or who to eliminate.<br><br>The basic ruleset of my game is as follows:<br>1) Each player has one checker piece that is evenly placed across a checkerboard, varying in size depending on player count. <br>2) Players can only move one space in the diagonal direction similar to checkers, however they are also allowed to move in backwards diagonal directions<br>3) To eliminate a player, they must &ldquo;skip&rdquo; over another player in the diagonal direction, again similar to checkers.<br>4) The pacing is determined by rounds, each consisting of around 30-60 seconds<br>5) Each round the player is allowed one move, and if the player does not move by the end of the round, they are forced onto a random valid space<br>6) There is no priority given to players in terms of who moves first, the rounds function in real-time, and whoever enacts their turn first will also move first<br>7) Alternatively, a player can give their move to another player, allowing the other player to move 2 spaces instead of 1.<br>8) This mechanic can be chained across many players, and serves as the main spark of discussion and the forming of alliances<br>9) Players will also have a chat feature, where players can freely discuss strategy to each other but will only be seen by each other<br>10) The board size will decrease as the rounds go on, and the last standing player is determined the winner<br><br>&emsp;This video serves as heavy inspiration for the core mechanics but with variations in the details of the game: https://www.youtube.com/watch?v=aOYbR-Q_4Hs. The main issue that plagued this game was that the stakes became too high and were negatively impacting the player&rsquo;s interpersonal relationships, however I believe the much faster placing and relative anonymity of my game will significantly reduce the game&rsquo;s stakes.<br>",
